import { Box, Button, ButtonGroup, Hidden, Stack, Typography, styled } from '@mui/material'
import React from 'react'
import Theme from '../../Component/Theme';

const theme=Theme();

const UserTitleBox=styled(Stack)(({theme})=>({
    marginTop:"10px",
    marginBottom:"20px",
    width:500,
    [theme.breakpoints.down("md")]:{
        width:350,
    },
    //backgroundColor:"red",
    //paddingLeft:"100px",
    //paddingRight:"100px",
    textAlign:"center",

}))

export default function Recovery({setRecoveryModel}) {
  return (
    <Stack sx={{
        backgroundColor:theme.palette.background.paper,
        width:700,
        height:800,
        borderRadius:theme.shape.borderRadius,
        overflow:"hidden"
        }}>
        <Stack display="flex" direction="row" justifyContent='end'>
            <Button
                variant="outlined" 
                onClick={()=>setRecoveryModel(false)}
            ><Typography variant='h5'>X</Typography>
            </Button>
        </Stack>

        <Stack alignItems="center">
            <UserTitleBox bgcolor="red">
                <Typography variant="h3">Recovery Password</Typography>
            </UserTitleBox>
            <Box>
                <Typography>Select a recovery method to proceed</Typography>
            </Box>
            <Stack  direction="row" >
                <ButtonGroup>
                    <Button variant='contained' sx={{width:150}}>Email</Button>
                    <Button variant="outlined" sx={{width:150}}>Mobile</Button>
                </ButtonGroup>
            </Stack>
        </Stack>

    </Stack>
  )
}
